decision_conditions:
The development hereby permitted shall not commence (except for demolition works) unless and until a surface water drainage scheme for the site (based on sustainable drainage principles SuDS) demonstrating regard to the recommendations of LBBD's 'Surface Water Management Plan' and 'Local Flood Risk Management Strategies', has been submitted to and approved in writing by the Local Planning Authority. The surface water drainage scheme shall include:
o	a surface water drainage scheme for the site, based on sustainable drainage principles and an assessment of the hydrological and hydro-geological context of the development;
o	a demonstration that the surface water run-off generated up to and including the 100 years plus Climate Change critical storm period will not exceed the run-off from the undeveloped site following the corresponding rainfall event;
o	a completed Barking and Dagenham Surface Water Drainage Pro-forma for new developments form;
o	details of how the proposed surface water drainage scheme will be maintained; and
o	a drainage scheme nominating the ownership, management and maintenance arrangements.

The surface water drainage scheme shall be implemented prior to the first occupation and/or use of the development and be constructed in accordance with the approved details. 

